; aWF_RT_Formule (aWLIFR_PrevoyanceRuleEngine) (Def Version:1) (Implem Version:1)
class aWF_RT_Formule (aWLIFR_PrevoyanceRuleEngine)
; Rule ; Classification ; FieldDesc ; VarDesc ; Indexes Of TableDesc procedure WFCalculate(inOut Result : Num8) if self.Donnees_Generale_Sinistre__Nombre_Enfants_A_Charge = 0 Result = 1.7 * (self.TrancheTA_annuelle(self.Traitement_de_base__Traitement_Brut_Annuel) + self.TrancheTB_annuelle(self.Traitement_de_base__Traitement_Brut_Annuel)) elseif self.Donnees_Generale_Sinistre__Nombre_Enfants_A_Charge = 1 Result = 2.8 * (self.TrancheTA_annuelle(self.Traitement_de_base__Traitement_Brut_Annuel) + self.TrancheTB_annuelle(self.Traitement_de_base__Traitement_Brut_Annuel)) else Result = 2.8 * (self.TrancheTA_annuelle(self.Traitement_de_base__Traitement_Brut_Annuel) + self.TrancheTB_annuelle(self.Traitement_de_base__Traitement_Brut_Annuel)) + 0.6 * (self.TrancheTA_annuelle(self.Traitement_de_base__Traitement_Brut_Annuel) + self.TrancheTB_annuelle(self.Traitement_de_base__Traitement_Brut_Annuel)) * (self.Donnees_Generale_Sinistre__Nombre_Enfants_A_Charge - 1) endIf endProc

