aWLIFR_IncapaciteTemporaireDeTravailBene.TextualDescription:
{\rtf1\ansi\ansicpg1252\deff0\deflang1036{\fonttbl{\f0\fnil\fcharset0 MS Sans Serif;}{\f1\fnil MS Sans Serif;}}
{\colortbl ;\red0\green0\blue0;}
\viewkind4\uc1\pard\cf1\f0\fs16 Indemnit\'e9s journali\'e8re vers\'e9e apr\'e8s une p\'e9riode de franchise \'e9gale \'e0 la p\'e9riode de maintien du salaire par l'employeur pr\'e9vu dans la convention collective. Ces indemnit\'e9s sont calcul\'e9es sur la base d'un pourcentage du salaire moins l'indemnit\'e9 journali\'e8re de la SS\par
Ex : salaire annuel 60 000\'80\par
Garantie contractuelle : 80% du salaire annuel (donc notre plafond de garantie est de 48 000\'80)\par
La S\'e9curit\'e9 sociale va indemniser sur une base de 33 000\'80 (soit 55% du salaire brut)\par
La garantie du contrat va donc intervenir sur la diff\'e9rence entre les 80% du du salaire de base et l'indemnit\'e9 de la SS : 48 000 - 33 000 = 15 000\'80\par
L'indemnit\'e9 journali\'e8re brute est donc vers\'e9e \'e0 l'emploueyr (souscripteur du contrat) qui le reversera sur la fiche de paie du salari\'e9 et sur laquelle sera retir\'e9e les charges salariales et patronales.\f1\par
}

